def count_vowels(s:str, k:int)->int:
    #Use a set for a faster lookup
    vowels = {'a', 'e', 'i', 'o', 'u'} 
    res = 0
    count = 0

    for i in range(k):
        if s[i] in vowels:
            count += 1
    res = count
    # Slide the window by starting from index k
    for i in range(k, len(s)):
        v = s[i - k] 
        if v in vowels:  # Remove the vowel going out of the window
            count -= 1
        if s[i] in vowels:  # Add the vowel coming into the window
            count += 1
        res = max(res, count)    
    return res
def main():
    print(count_vowels("abciiidef", 3))
    print(count_vowels("aeiou", 2))
    print(count_vowels("tryhard", 4))
    print(count_vowels("",50436))

main()